import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <div className="footer">
      <p>&copy; {new Date().getFullYear()} GreenLaz. All rights reserved.</p>
      <ul className="social-links">
        <li><a href="#facebook" aria-label="Facebook">Facebook</a></li>
        <li><a href="#twitter" aria-label="Twitter">Twitter</a></li>
        <li><a href="#instagram" aria-label="Instagram">Instagram</a></li>
      </ul>
    </div>
  );
};

const styles = {
  footer: {
    backgroundColor: '#4CAF50',
    color: 'white',
    padding: '10px 20px',
    textAlign: 'center',
    position: 'fixed',
    bottom: 0,
    width: '100%',
  },
};

export default Footer;
